import Header from 'components/header/header';
import { DrawerProvider } from 'contexts/drawer/drawer.provider';

import React from 'react';

const Blogs = () => {
    return (
        <div sx={styles.container}>
        <DrawerProvider>
            <Header></Header>
            </DrawerProvider>
            </div>
    )
};
const styles={
    container:{
        width:1140,
        margin:"0 auto"
    }

}
export default Blogs;
